import React, {useEffect, useState} from 'react';
import axios from 'axios';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import inventoryImage from "..images/inventoryImage.png";

import Header from './components/Header';
import Home from './components/Home';
import Makeup from './components/Makeup';
import Mens from './components/Mens';
import Womens from './components/Womens';
// import './App.css';


 class App extends React.Component {
  constructor (props) {
    super(props);
    this.state = {};
  }
  render(){
    return (
      <div>
        <Header />
    <Router>

      <div>
         <ul>
          <li>
           <Link to="/home">Home Inventory</Link>
           </li>
           <li>
             <Link to="/makeup">Makeup Inventory</Link>
           </li>
          <li>
             <Link to="/mens">Mens Inventory</Link>
           </li>
           <li>
             <Link to="/womens">Womens Inventory</Link>
          </li>
          </ul>
           <Switch>
           <Route path="/home">
             <Home />
           </Route>
           <Route path="/makeup">
             <Makeup />
           </Route>
           <Route path="/mens">
             <Mens />
           </Route>
           <Route path="/womens">
             <Womens />
           </Route>
          </Switch>
          </div>
          </Router>
          </div>
);
  }
}
export default App;
